// COMPONENTS
import React from 'react';
import Logo from '../../../img/logo.png';

// CSS
import './index.css'

export default props => {
  return (
    <div className='logo-footer'>
      <img className="logo-just" src={Logo} width={props.largura} heigh={props.altura} alt=""/>
    </div>
  );
}
